VALUES ('3596710444748', 'AUCHAN - Glace vanille sorbet fruits rouge', 'bâtonnets de glace à la vanille, enrobage  au chocolat blanc, sorbet aux fruits rouge., surgelés “  Glace à la Vanille 46,2% : lait écrémé reconstitué (origine UE, Suisse), sucre, graisse végétale de coco, sirop de glucose, eau, lactose (contient lait) et protéines de lait, émulsiﬁants : mono— et diglycérides d’acides gras ; stabilisants : farine de graines de caroube, gomme guar, carraghénanes ; arôme naturel de vanille.  Enrobage au chocolat blanc 30,7% : beurre de cacao, sucre, lait entier en poudre, matière grasse laitière anhydre (contient lait), émulsifiant : lécithine de soja, arôme naturel de vanille.  Sorbet aux fruits rouges 23 1% : eau, purée de fraise 4%, sucre. sirop de glucose, purée de framboise 1,6%, fructose, jus de cassis à base de concentré 1,4% ; colorants : anthocyanes, curcumine ; acidiﬁant : acide citrique, émulsiﬁant: méthylcellulose; stabilisants : pectines, farine de graines de caroube ; arôme  naturel. Traces éventuelles d‘œufs et fruits à coque', 'https://static.openfoodfacts.org/images/products/359/671/044/4748/front_fr.5.400.jpg', '21', '14', '30', '26', '0', '2.8', '0.13', '0.0511811023622047', '0', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710444755', 'Cacahuètes sauce caramel', ' Glace à la cacahuète 56,1 % : eau, lait écrémé réhydraté (origine UE), sucre, sirop de glucose-fructose, graisse végétale (coprah), lactose (contient lait) et protéines de lait, sirop de glucose, pâte de cacahuètes (arachides) 1,4% ; émulsifiants : mono - et diglycérides dlacides gras, esters lactiques des mono - et diglycérides diacides gras ; gélifiants :\'farine de graines de caroube, gomme guar ; colorant : caroténoïdes. Enrobage chocolat au lait 27,1% : sucre, beurre de cacao, poudre de lactosérum (contient lait), matière grasse laitière anhydre (contient lait), pâte de cacao, poudre de lait écrémé ; émulsifiants : lécithine de soja, polyricinoléate de polyglycérol. Sauce caramel 129% : sirop de glucose, lait écrémé concentré, sucre, eau, dextrose, beurre de cacao, crème (contient lait), beurre (contient lait), gélifiants : pectines, sel, émulsifiant : mono - et diglycérides d\'acides gras, arôme naturel. Morceaux de cacahuètes (arachides) grillées 3,9%.', 'https://static.openfoodfacts.org/images/products/359/671/044/4755/front_fr.4.400.jpg', '20', '12', '34', '30', '', '3.8', '0.269999999999999', '0.106299212598425', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710444762', 'Les Plaisirs Glacés Bâtonnets Vanille Amandes', 'Glace à la vanille 70.6 % : _lait_ écrémé réhydraté (origine UE), eau, sucre, graisse végétale (coprah), sirop de glucose-fructose, sirop de glucose, _lactose_ (contient _lait_) et protéines de _lait_, émulsifiant mono- et diglycérides d\'acides gras ; gélifiants farine de graines de caroube, gomme guar arôme naturel de vanille 0,07 %, gousses de vanille broyées épuisées 0,03 % ; colorants rocou, curcumine. Enrobage chocolat au lait 25.9 %: sucre, beurre de cacao, poudre de _lactosérum_ (contient _lait_), matière grasse de _lait_ anhydre, pâte de cacao, poudre de _lait_ écrémé ; émulsifiants: lécithine de _soja_, polyricinoléate de polyglycérol. Morceaux d\'amandes (_fruits à coque_) grillées 3.5 %.', 'https://static.openfoodfacts.org/images/products/359/671/044/4762/front_fr.17.400.jpg', '20', '13', '31', '28', '', '3.4', '0.19', '0.0748031496062992', '', '0');

